import './SimpleCategory.css';

const SimpleCategory = (props) => {
    return (
        <div className='simple-categories'>
            <div className='simple-cat' color='red'>
                <p>Clothing</p>
            </div>
            <div className='simple-cat-container'>
                <p>Handphone Accessories</p>
            </div>
            <div className='simple-cat-container'>
                <p>Bathroom</p>
            </div>
            <div className='simple-cat-container'>
                <p>Garden</p>
            </div>
            <div className='simple-cat-container'>
                <p>DIY & Crafts</p>
            </div>
        </div>
    )
};

export default SimpleCategory;
